  property("Signatures message should be deserialazable by old code") {
    forAll(newSignaturesMessages) { (message, signatures) =>
      val sigs = signatures.split(",").filter(_.nonEmpty).map(Base58.decode(_).get)
      val messageBytes = Base58.decode(message).get
      val restored = handler.parseBytes(ByteBuffer.wrap(messageBytes), None).get
      assert(restored.spec == repo.SignaturesSpec)
      restored.data.get match {
        case restoredSignatures: Seq[Array[Byte]] =>
          restoredSignatures should contain theSameElementsAs sigs
        case _ =>
          fail("wrong data type restored")
      }
    }
  }

